/** @format */

import React from "react";
import { Toast } from "react-bootstrap";

const NotData = () => {
  return (
    <div
      className="toast"
      role="alert"
      aria-live="assertive"
      aria-atomic="true">
      <div className="toast-body">Hello, world! This is a toast message.</div>
    </div>
  );
};

export default NotData;
